    if("WebSocket" in window){
      websocket = new WebSocket(url);
    }
    else if("MozWebSocket" in window){
      websocket = new MozWebSocket(url);
    }
    else{
      throw new Error("WebSocket isn't supported by this browser.");
    }
    websocket.binaryType = "arraybuffer";

